def RewriteOneAbund(Element,chosenelem,zone,replacer):
    if zone==0:Element[0:12,chosenelem]=replacer
    if zone==1:Element[12:22,chosenelem]=replacer
    if zone==2:Element[22:32,chosenelem]=replacer
    if zone==3:Element[32:45,chosenelem]=replacer
    if zone==4:Element[45:68,chosenelem]=replacer
    if zone==5:Element[68:109,chosenelem]=replacer
    return Element

def densMaker(dSamp):
    pivot,slope=dSamp[0],dSamp[1]
    CHdens=IGEdens.copy()
    CHdens[:,2]=CHdens[:,2]**slope
    CHdens[:,2]=CHdens[:,2]/CHdens[30,2]*IGEdens[30,2]*pivot
    return CHdens

def elemWriteFile(Element,fileName):
    Element=pd.DataFrame(Element)
    Element.to_csv(fileName,index=True,header=False,sep=' ')
    time.sleep(0.1)
    with open(fileName,'r+') as f:
        old=f.read()
        f.seek(0)
        f.write('# index Z=1 - Z=30\n')
        f.write(old)
    time.sleep(0.1)
    return

def densWriteFile(densData,fileName):
    densHeader='''11.5741 day
 #index velocity (km/s) density (g/cm^3)
'''
    pdOut=pd.DataFrame(densData)
    pdOut.to_csv(fileName+'_back',index=True,header=False,sep=' ')
    time.sleep(0.1)
    with open(fileName+'_back','r') as reader:
        densOut=reader.read()
    time.sleep(0.1)
    with open(fileName,'w') as writter:
        writter.write(densHeader+densOut)
    time.sleep(0.1)
    return

def seqSpecMaker(snName,sequenceDir,cacheDir,atomData,threadCount=8):

    tableData=np.load(sequenceDir+'/'+snName+'_Aux.npy')
    elemData=np.load(sequenceDir+'/'+snName+'_Elem.npy')

    if os.path.exists(sequenceDir+'/'+snName+'.spec.npy'):fluxList=np.load(sequenceDir+'/'+snName+'.spec.npy')
    else:fluxList=np.zeros([len(tableData),2000])

    for indexer in range(len(tableData)):
        if fluxList[indexer].sum()>0:continue
        YamlHere={'atom_data': atomData,
                  'model': {'abundances': {'filename': snName+'.elem.dat',
                                           'filetype': 'simple_ascii',
                                           'type': 'file'},
                            'structure': {'filename': snName+'.dens.dat',
                                          'filetype': 'simple_ascii',
                                          'type': 'file',
                                          'v_inner_boundary': str(tableData[indexer,2])+' km/s',
                                          'v_outer_boundary': '35900 km/s'}},
                  'montecarlo': {'convergence_strategy': {'damping_constant': 1.0,
                                                          'fraction': 0.8,
                                                          'hold_iterations': 3,
                                                          't_inner': {'damping_constant': 1.0},
                                                          'threshold': 0.05,
                                                          'type': 'damped'},
                                 'iterations': 15,
                                 'last_no_of_packets': 800000,
                                 'no_of_packets': 180000,
                                 'no_of_virtual_packets': 6,
                                 'nthreads': threadCount,
                                 'seed': 16606159},
                  'plasma': {'disable_electron_scattering': False,
                             'excitation': 'dilute-lte',
                             'ionization': 'nebular',
                             'line_interaction_type': 'macroatom',
                             'radiative_rates_type': 'detailed'},
                  'spectrum': {'num': 2000, 
                               'start': '2000 angstrom', 
                               'stop': '10000 angstrom'},
                  'supernova': {'luminosity_requested': str(tableData[indexer,0])+' log_lsun',
                                'luminosity_wavelength_end': '7500 angstrom',
                                'luminosity_wavelength_start': '6500 angstrom',
                                'time_explosion': str(tableData[indexer,1])+' day'},
                  'tardis_config_version': 'v1.0'}

        YamlHere['montecarlo']['seed']=np.random.randint(36789212)
    
        elemNew=IGEelem.copy()
        elemCh=elemData[indexer]
        for zone in range(elemCh.shape[0]):
            for elemIndex in range(1,elemCh.shape[1]+1):
                elemNew=RewriteOneAbund(elemNew,elemIndex,zone,elemCh[zone,elemIndex-1])
        densNew=densMaker(tableData[indexer,3:5])
        elemWriteFile(elemNew[:,1:],cacheDir+'/'+snName+'.elem.dat')
        densWriteFile(densNew[:,1:],cacheDir+'/'+snName+'.dens.dat')
        time.sleep(0.1)
        with open(cacheDir+'/'+snName+'.yml','w') as writter:yaml.dump(YamlHere,stream=writter)
        com=os.popen('tardis '+cacheDir+'/'+snName+'.yml '+cacheDir+'/'+snName+'.flux.dat')
        print(com.read())
        fluxList[indexer]=np.loadtxt(cacheDir+'/'+snName+'.flux.dat')[:,1]
        np.save(sequenceDir+'/'+snName+'.spec.npy',fluxList)


